import DataTable from 'react-data-table-component';
import React, { useState, useEffect } from 'react';

export default function Tablon(url){
    var urlfecht = url
    const [data, setData] = useState(null)
    const [isLoading, setIsLoading] = useState(true)
    const [error, setError] = useState(null)

    useEffect (()=>{
      fetch(urlfecht)
        .then(response => response.json())
        .then(result =>{
          setIsLoading(false);
          setData(result);
        }, error=>{
          setIsLoading(false);
          setError(error);
        })
    },[]);

      const columns = [
        {
          name: 'Frase',
          selector: 'data.quote',
          sortable: true,
        },
        {
          name: 'Personaje',
          selector: 'data.character',
          sortable: true,
        },
        {
          name: 'Imagen',
          selector: 'data.image',
          sortable: true,
        },
        {
          name: 'Politica',
          selector: 'characterDirection',
        },
      ];


    return(
      console.log(data)
    )

}
